content:
작가님 너무 하신거 아닙니까?



만화를 그리셔야지
왜 시를 쓰시고 교훈을 주셔욧^^;

우리 준풍이가  엄마 말씀처럼 멋지게 생기긴 했구나야~  꽤 괜찮은 아가씨들이 마음을 보여주는것이...    
   &quot;티끌일지언정,   하늘을  채우고 있었잖아&quot;
이 시의 구절이  마음에 가득 와닿습니다 아무리 넓은 세상이라는 공간이 있다하여도   우리는 알잖아요  지금 내가 사랑하고 있는 그  사람이  내게는 온 우주라는  걸...

저 할머니 보소;;;
어이가 없네..
자신이 아들을 잘 보지 않아서 일어난 일인데, 왜 홍조 탓을 하냐고요
